     } 
    render() { 
        return (
            <table className="table">
                <thead>
                    <tr>
                        <th>title</th>
                        <th>gener</th>
                        <th>stock</th>
                        <th>rate</th>
                    </tr>
                </thead>
                <tbody>
                    {this.state.movies}
                    <tr>
                        <td></td>
                        <td></td>
                        <td></td>
                        <td></td>
                    </tr>
                </tbody>
            </table>
            );
    }
}
 
export default Movies;
